import { redirect } from 'react-router-dom';
import logo1 from '../media/logo1.png'

function Logo1(){
    return (
        <a  
            onClick={e=>{
                e.preventDefault()
                redirect('/')
            }

        }>
            <img src={logo1} alt="" 
                srcset="" className="rounded mx-auto d-block w-25 vh-75" 
                />
        </a>
    )
}

export default Logo1;
